public class MemcachedCacheProvider : ICacheProvider\n   {\n       // Assume you have a Memcached client instance available\n       private readonly IMemcachedClient _memcachedClient;\n\n       public MemcachedCacheProvider(IMemcachedClient memcachedClient)\n       {\n           _memcachedClient = memcachedClient;\n       }\n\n       public void Delete(string key)\n       {\n           _memcachedClient.Remove(key);\n       }\n\n       public object Get(string key)\n       {\n           return _memcachedClient.Get(key);\n       }\n\n       public bool HasKey(string key)\n       {\n           return _memcachedClient.Get(key) != null;\n       }\n\n       public void Store(string key, object data)\n       {\n           _memcachedClient.Store(StoreMode.Set, key, data);\n       }\n   }